import {Faucet, Mortal} from "./Faucet.sol";

contract Token is Mortal {
    Faucet _faucet;

    constructor(address _f) {
        _faucet = Faucet(payable(_f));
        // transfer to current contract
        _faucet.withdraw(0.1 ether, address(this));
    }
}
